import Head from 'next/head'

import Navbar from '../component/Navbar'
const Index = (props) => (
        <div className="container">
            <Navbar></Navbar>
            <h1>Hola Next.js</h1>
            <p>Check current Bitcoin rate</p>
            <style jsx global>
                {`
                    body:{
                        margin: 0;
                        padding: 0;
                    }
                `}
             </style>
        </div>


);

export default Index;
